#include <stdio.h>

//O(n) = 1.最大时间复杂度为O(n^2)
void insertsort(int *a,int size)
{
	if (a == NULL || size == 0)
	{
		return ;
	}
	
	int i = 0,j = 0,k = 0;
	int tmp = 0;
	for (i=1;i < size;i++)
	{
		if (a[i] < a[0])//若当前待排序数小于递增的有序序列中的第一个数，则将当前待排序序列插入为有序序列的第一个数
		{
			tmp = a[i];
			for (j = i ; j >=1;j--)//有序序列中的数全部往后移一个位置
			{
				a[j] = a[j-1];
			}
			a[0] = tmp;
		}
		else if(a[i] >= a[i-1])//直接插入在尾部
		{
			continue;
		}
		else 
		{
			for (j = 0;j <=i;j++)//寻找插入位置:经过前面两个判断，待插入的位置一定在有序序列中
			{
				if (a[i] > a[j])
				{
					continue;
				}
				
				tmp = a[i];
				for (int k = i;k >= j;k--)
				{
					a[k] = a[k-1];
				}
				a[j] = tmp;
			}
		}
	}
}

